// const counter = 8; this is just like a variable that doesnt change

//this below is our component that returns JSX to index.html 
function App(){

    //we can add logic to this code
    const sayHello = () => {
        console.log("HEllo react from Bere")
    }

    return(
        <div>
            <h1>Hello React</h1>
            <button onClick={sayHello}>    Hello world </button> 
        </div>
    )
}

export default App;
